import React from 'react';
import '../App.css';

const Home = () => {
  const youtubeUrl = 'https://youtu.be/LTzmjU8aOR4'; // grab this from the random video fetcher
  return (
    <div id = "page-wrap">
    { <>
      <h1>HOME PAGE</h1>
      <div style={{padding: '10px'}}>
        <iframe
          width="560"
          height="315"
          src="https://www.youtube.com/embed/VIDEO_ID"
          title="YouTube video player"
          frameborder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </div>

      <iframe title="downloadFrame" src={`http://convert2mp3s.com/api/single/mp3?url=${youtubeUrl}`}
        width="50%" height="50%" allowtransparency="true" scrolling="no" style={{ border: 'none' }}></iframe></>
    }
  </div>
  );
};

export default Home;
